objet:
Cette association, ouverte à tous, a pour objet, dans la fidélité au saint siège et le respect de la doctrine constante de l'Eglise, 
- de contribuer à l'application du Motu Proprio Ecclesia Dei en Lorraine selon la volonté de Sa Sainteté Jean Paul II ;
- De promouvoir, soutenir et développer les activités d'ordre litturgique, spirituel, culturel, éducatif ou caritatif concourant à la vitalité de la tradition et à la réalisation de sa vocation missionnaire.

Imaginer, créer, concevoir, organiser et participer à tous types de projets et de réalisations visant à favoriser, dans le domaine de l'environnement et de la recherche en environnement, au niveau local, départemental, régional, national et international toutes :
- les initiatives, les actions, l'information, la formation, les échanges à caractère pédagogique, culturel, scientifuque, relationnel, social et humanitaire ;
- toutes formes de médias, ainsi qu'à toutes les technologies de communication multimédia

l'association a pour but :
- de diriger, organiser, développer, promouvoir et défendre la pratique du cyclotourisme, sous toutes ses formes, dans l'inter-régions grand est ;
- encourager le voyage à bicyclette entre ces régions ;
- développer un tourisme individuel et culturel autre que de masse et garantir la prévention du patrimoine et le respect des personnes qui y habitent ;
- contribuer à la protection des paysages, des sites touristiques, de la nature, de l'environnement et développer le tourisme durable ;
- rechercher une étroite collaboration avec d'autres organismes qui se consacrent à la randonnée, à la nature, au sport santé, au tourisme, à l'environnement et à la culture ;
-poursuivre des buts d'intérêtsgénéral de la F.F.C.T;
- gérer un emploi de conseiller fédéral de cyclotourisme (C.F.C.)
